        int target = Integer.parseInt(br.readLine());

        Solution sol = new Solution();
        int[] ans = sol.twoSum(nums, target);
        System.out.print("[");
        for (int i = 0; i < ans.length; i++) {
            System.out.print(ans[i] + (i == ans.length - 1 ? "]" : ","));
        }
        System.out.println();
    }
}

